import React from 'react';
import './AboutMe.css'; // Add this for styling
import profilePhoto from './"C:\Users\kyzo\Pictures\frieren-wallpaper-4k-made-by-me-3-v0-for3cbmfqjoc1.webp"'; // Replace with your photo path

function AboutMe() {
  return (
    <section id="about">
      <h2>About Me</h2>
      <div className="about-content">
        <div className="profile-circle">
          <img src={profilePhoto} alt="Profile" />
        </div>
        <p>Turning ideas into real-life products is my calling.</p>
      </div>
    </section>
  );
}

export default AboutMe;
